import React from "react";
import { NavLink, useNavigate } from "react-router-dom";
import { IoPerson, IoHome, IoLogOut, IoCashOutline } from "react-icons/io5";
import { AiOutlineCar } from "react-icons/ai";
import { useDispatch, useSelector } from "react-redux";
import { LogOut, reset } from "../features/authSlice";
import styled from "styled-components";

const StyleSideBar = styled.aside`
  padding: 3.2rem 1.4rem;
  border-right: 1px solid var(--color-grey-100);
  grid-row: 1 / -1;
  font-family: "Arial", sans-serif;
  font-size: "14px"
`;

const MenuItem = styled.li`
  margin-bottom: 1rem;
  font-size: 1.6rem;
`;

const MenuLink = styled(NavLink)`
  display: flex;
  align-items: center;
  text-decoration: none;
  color: black;
  font-size: 0.6rem;

  &:hover {
    color: gray;
  }

  &.active {
    color: blue;
  }
`;

const Icon = styled.span`
  margin-right: 0.5rem;
`;

const Sidebar = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { user } = useSelector((state) => state.auth);

  const logout = () => {
    dispatch(LogOut());
    dispatch(reset());
    navigate("/");
  };

  return (

    <div className="sidebar">
      <StyleSideBar >
        {/* <p >General</p> */}
        <ul className="menu-list">
          <li>
            <NavLink to={"/dashboard"}>
              <IoHome 
              //  style={{
              //   color: "",
              //   backgroundColor: "rgba(122,255,0,0.25)",
              //   borderRadius: 20,
              //   fontSize: 24,
              //   padding: 8,
              // }}
              /> Dashboard
            </NavLink>
          </li>
          <li>
            <NavLink to={"/vehicules"}>
              <AiOutlineCar /> Vehicules
            </NavLink>
          </li>
          <li>
            <NavLink to={"/vitreFumees"}>
              <AiOutlineCar /> Vitre fumee
            </NavLink>
          </li>
          <li>
            <NavLink to={"/policeStations"}>
              <AiOutlineCar /> Police Station
            </NavLink>
          </li>
          <li>
            <NavLink to={"/penaltiess"}>
                  <IoCashOutline /> Penalties 
                </NavLink>
          </li>
        </ul>
        {user && user.role === "admin" && (
          <div>
            {/* <p className="menu-label">Admin</p> */}
            <ul className="menu-list">
              <li>
                <NavLink to={"/users"}>
                  <IoPerson /> Users
                </NavLink>
              </li>
              <li>
                <NavLink to={"/penalties"}>
                  <IoCashOutline /> Penalty Type
                </NavLink>
              </li>
            </ul>
          </div>

        )}

        <p className="menu-label">Settings</p>
        <ul className="menu-list">
          <li>
            <button onClick={logout} className="button is-white">
              <IoLogOut /> Logout
            </button>
          </li>
        </ul>
      </StyleSideBar>
    </div>
  );
};

export default Sidebar;
